import React from 'react';
import Card from '../UI/Card';
import s from './MealList.module.css';

const DUMMY_MEALS = [
  {
    id: 'm1',
    name: 'Ролл Наоми',
    description:
      'Сыр филадельфия, куриное филе, масаго, помидор, огурец, кунжут',
    price: 11.99,
  },
  {
    id: 'm2',
    name: 'спайс в лососе',
    description: 'Рис, лосось, соус спайс',
    price: 3.99,
  },
  {
    id: 'm3',
    name: 'Суши с угрем',
    description: 'Угорь копченый, соус унаги, кунжут',
    price: 4.99,
  },
  {
    id: 'm4',
    name: 'Поке с лососем',
    description:
      'Рис, лосось, огурец, чука, нори, стружка тунца, соус ореховый',
    price: 8.99,
  },
];

const MealList = (props) => {
  const mealList = props.cards.map((card) => {
    return (
      <li>
        {card.name} {card.description}
      </li>
    );
  });

  return (
    <section className={s.meals}>
      <ul> {mealList}</ul>
    </section>
  );
};

export default MealList;
